import Todo from "./components/Todo";
function App(props) {
  function removeTodo(){
    console.log("Removing" + props.text);
  }
  return (
    <div>
      <h1>My TODOS</h1>
      <Todo text="First" onRemove={removeTodo}/>
      <Todo text="Second" onRemove={removeTodo}/>
      <Todo text="Third" onRemove={removeTodo}/>
    </div>
  );
}
export default App;
